import React, { useState } from "react";
import Chart from "../steps/chart";
import Select from "react-select";
import "./frame.css";
import FrameIndicator from "./frame-indicator";

const Frame = (props) => {
  
  return (
    <div class="row">
      <div class="form-group row">
     
      <FrameIndicator />
      
    </div>
    </div>
  );
};
export default Frame;
